import React, { useState } from 'react';
import infoArr from "../../infoArr";
import { useNavigate } from 'react-router-dom';
import './Booklist.css';

const Booklist = () => {
    const [searchTerm, setSearchTerm] = useState("");
    const navigat = useNavigate();

    const handleSearchChange = (e) => {
        setSearchTerm(e.target.value);
    };

    const filteredBooks = infoArr.filter(info =>
        info.bookName.toLowerCase().includes(searchTerm.toLowerCase())
    );

    const navigateToBook = (info) => {
        navigat(info.id, { state: { id: info.id } });
    };

    return (
        <div className="booklist-container">


            {/* <input
                type="text"
                placeholder="Search Books"
                value={searchTerm}
                onChange={handleSearchChange}
                className="booklist-input"
            /> */}

            <div id="search">
                <svg viewBox="0 0 420 60" xmlns="http://www.w3.org/2000/svg">
                    <rect class="bar" />

                    <g class="magnifier">
                        <circle class="glass" />
                        <line class="handle" x1="32" y1="32" x2="44" y2="44"></line>
                    </g>

                    <g class="sparks">
                        <circle class="spark" />
                        <circle class="spark" />
                        <circle class="spark" />
                    </g>

                    <g class="burst pattern-one">
                        <circle class="particle circle" />
                        <path class="particle triangle" />
                        <circle class="particle circle" />
                        <path class="particle plus" />
                        <rect class="particle rect" />
                        <path class="particle triangle" />
                    </g>
                    <g class="burst pattern-two">
                        <path class="particle plus" />
                        <circle class="particle circle" />
                        <path class="particle triangle" />
                        <rect class="particle rect" />
                        <circle class="particle circle" />
                        <path class="particle plus" />
                    </g>
                    <g class="burst pattern-three">
                        <circle class="particle circle" />
                        <rect class="particle rect" />
                        <path class="particle plus" />
                        <path class="particle triangle" />
                        <rect class="particle rect" />
                        <path class="particle plus" />
                    </g>
                </svg>
                <input
                    type="text"
                    placeholder="Search Books"
                    value={searchTerm}
                    onChange={handleSearchChange}
                    className="booklist-input"
                    aria-label="Search for inspiration"
                />
            </div>

            <div id="results">

            </div>
            <div className='sss'>
                {
                    filteredBooks.map((info, index) => (
                        <div key={index} className="book-item" onClick={() => navigateToBook(info)}>
                            <img src={info.imageUrl} alt={info.bookName} />
                            <h1>{info.bookName}</h1>
                        </div>
                    ))
                }
            </div>
        </div>
    );
};

export default Booklist;
